import React from 'react'

function Billing({items, loading}) {

if(loading){
        return <h2>Loading...</h2>
}
return (
    <ul className='list-group mb-2'>
        {
            items.map((item) => (
                <li className='list-group-item'>
                    {item[1]}
                </li>
            ))
        }
    </ul>
  );
}

export default Billing;
